text:
Parabéns ao nosso excelente elenco, a nossa comissão técnica e equipe de análise de contratações. Temos jogadores com características técnicas diferentes que dão opção ao treinador de mudar um jogo em função das citadas características:
Exemplo 1: Victor Sá, jogador polivalente, atua pela esquerda, faz bem o 1 contra 1, bate com os dois pés, tem bons passes e é um garçon como poucos. Contra o coxa foi decisivo em 3 dos 4 gols. Ainda taticamente apoia bem o meio campo e auxilia na marcação junto com o lateral. Decisivo também no último jogo contra o Inter, pois ao passar para a ponta direita, oportunizou a entrada do Luis Henrique e funcionou com ponta direita indo ao fundo várias vezes. Para arrematar, aparece muitas vezes na grande área arrematando para o gol. Contra o Inter seu primeiro gol abriu as portas para a vitória;
Exemplo 2: Sauer, habilidoso, excelente chute, atua entrando por dentro e arrematando no gol, como também auxiliando no meio campo e lateral. Decisivo nos dois gols contra o Coxa;
Exemplo 3: Janderson, importante papel de prender os zagueiros dentro da área, os fustigando, arrematando ao gol, servindo os companheiros. Não se omite volta pra marcar no meio campo e defesa, quando a situação  exige.
Resumo, valorizar a todo o elenco e a cada um, os apoiando incondicionalmente, entendendo a qualidade de se agrega ao grupo com as características técnicas diversas que apresentam. Fundamental, nossos jogadores são seres humanos como qualquer um de nós, que apesar de atuarem em altíssimo nível, por vezes erram, falham sem a intenção de fazê-lo. É evidente, todo o nosso elenco dá sempre o melhor pelo Botafogo.  Eternamente Botafogo.

